import React from "react";
import Navbar from "../components/NavBar";
export default function Dashboard() {
  return (
    <div style = {styles.container}>
      <Navbar />
      <div>Dashboard</div>
      <button style={styles.button}>View Subscriptions</button>
    </div>
  );
}
const styles = {
  container:{
    marginTop:50,
  },
  button: {
    width: "200",
  },
};
